import logo from './logo.svg';
import Hero from './components/Hero'
import About from './components/About'
import Work from './components/Work'
import Contact from './components/Contact'
import Navbar from './components/Navbar';
import Socials from "./components/Socials"
import Topography from "./components/Topography"
import './App.css';
import React, {useState, useCallback, useRef,useEffect} from 'react'
import gsap from 'gsap'
import Tilt from 'react-tilt'

function App() {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const sceneEvent = useRef(null);


  return (
    <div className="App">
      <Navbar state={{ isMenuOpen: [isMenuOpen, setIsMenuOpen] }}/>
      <div >
        <Tilt className="tilt" options={{ max : 25 }}>
        <Topography className="tilt-inner">
          <Socials className="tilt-inner"></Socials>
          <Hero className="hero tilt-inner"></Hero>
          <About className="tilt-inner"></About>
        </Topography>
        </Tilt>
      </div>
      <Work></Work>
      <Contact></Contact>
    </div>
  );
}

export default App;
